import React from 'react'

const Noteitem = (props) => {
    const { note } = props;
    return (
        <div>
            {/* {note.title}
            {note.description} */}
            <div class="card col-md-3" >
                <div class="card-body">
                    <h5 class="card-title">{note.title}</h5>
                    <p class="card-text">{note.description}</p>
                    <a href="#" class="btn btn-primary">View Note</a>
                </div>
            </div>
        </div>
    )
}

export default Noteitem
